import React from "react";
// import "./components/styles/Header.css";

const styles = {

  header: {
    background: "#f9b713",
    height: "200px",
  },
  h2: {
    margin: 0,
    paddingTop: "75pz",
    textAlign: "center",
    color: "white",
    fontSize: "3rem",
  }
}

function Header() {
  return (
    <header style={styles.header}>
      <h2 style={styles.h2}>Welcome To Recs & Park</h2>
      <p>
       In Partnership with the NYC Parks Department
      </p>
    </header>
  );
}

export default Header;
